import React from 'react';

const LOGIC_BLOCKS = [
  { label: 'Smart Buys in 10m', color: 'text-pink-300', icon: 'ü§ñ' },
  { label: 'Volume Spike > X%', color: 'text-blue-300', icon: 'üìà' },
  { label: 'Exclude Exit Liquidity', color: 'text-red-400', icon: '‚ùå' },
  { label: 'GambleFi Tag', color: 'text-purple-300', icon: 'üé≤' },
];

const previewTokens = [
  { name: 'PAWPAW', risk: 'Low', meta: 'GambleFi', roi: '+24%' },
  { name: 'BABY BOB', risk: 'Low', meta: 'GambleFi', roi: '+34%' },
];

export default function BuilderTab({ goBack, template }) {
  return (
    <>
      <section className="flex h-screen w-full bg-zinc-950 text-white">
        {/* Left Column: Logic Blocks */}
        <aside className="w-1/4 border-r border-neutral-800 p-4">
          <h2 className="text-xl font-bold mb-4">Logic Blocks</h2>
          <div className="space-y-3">
            {LOGIC_BLOCKS.map((block) => (
              <div key={block.label} className="block-item bg-zinc-900 p-3 rounded-md flex items-center gap-2">
                <span className={block.color}>{block.icon}</span> {block.label}
              </div>
            ))}
          </div>
        </aside>

        {/* Middle Column: Strategy Canvas */}
        <main className="w-2/4 p-6">
          <div className="flex justify-between items-center mb-4">
            <h2 className="text-xl font-bold">Strategy Canvas</h2>
            <button className="text-red-500 text-sm">Clear All</button>
          </div>
          <div className="h-[80%] border border-neutral-800 rounded-xl p-4 bg-zinc-900 flex items-center justify-center">[Drag blocks here]</div>
          <div className="mt-4 text-sm text-gray-500">Plain-text Summary: "Smart Wallet Buys + Volume Spike &gt; 50% + No Exit Liquidity"</div>
        </main>

        {/* Right Column: Token Preview */}
        <aside className="w-1/4 border-l border-neutral-800 p-4">
          <div className="flex justify-between items-center mb-4">
            <h2 className="text-xl font-bold">Token Preview</h2>
            <span className="text-green-400 text-xs bg-green-900 rounded px-2 py-1">LIVE</span>
          </div>
          <div className="space-y-3">
            {previewTokens.map((t) => (
              <div key={t.name} className="preview-card bg-zinc-900 p-3 rounded-md">
                <div className="font-semibold">{t.name}</div>
                <div className="text-xs text-gray-400">Risk: {t.risk} ‚Ä¢ Meta: {t.meta}</div>
                <div className="text-green-400 font-bold text-right">{t.roi}</div>
              </div>
            ))}
          </div>
        </aside>
      </section>
      {/* Save / Publish Buttons */}
      <footer className="fixed bottom-4 right-4 flex gap-4 z-50">
        <button className="bg-neutral-800 border border-gray-600 px-4 py-2 rounded text-white">Save Draft</button>
        <button className="bg-green-500 px-4 py-2 rounded text-black font-bold">Publish Flow</button>
      </footer>
      <style>{`.block-item:hover { background-color: #2c2c3a; cursor: grab; }`}</style>
    </>
  );
}
